                "subtitle": "Півзахисник домовився про дворічний контракт.",
                "body": "<p>Міланський Інтер останніми днями помітно активізував свою роботу на трансферному ринку, спочатку оголосивши про повернення нападника лондонського Челсі Ромелу Лукаку, після чого придбавши півзахисника Емполі Крістьяна Асслані, а також досягнувши логічного завершення перемовин стосовно двох вільних агентів: півзахисника Генріха Мхітаряна та голкіпера Андре Онана.</p>\n\n<p>Залишалось лише дочекатись моменту, коли &quot;змії&quot; оголосять про нові придбання на широкий загал, що й відбулося декількома хвилинами раніше.</p>\n\n<p>33-річний вірменський півзахисник невдало провів перемовини щодо продовження контракту зі своїм колишнім клубом, Ромою, після чого отримав пропозицію від &quot;нерадзуррі&quot;.</p>\n\n<p>Дворічна угода з досвідченим виконавцем була підписана вже незабаром, і, як повідомляють у міланському клубі, Генріх уже готовий долучитися до табору Сімоне Індзагі перед початком літніх зборів</p>\n\n<div class=\"youtube-embed-wrapper\" style=\"height:0; overflow:hidden; padding-top:30px; padding-bottom:50%; position:relative\"><iframe frameborder=\"0\" height=\"360\" src=\"https://www.youtube.com/embed/hCcHoysP5dI\" style=\"position:absolute;top:0;left:0;width:100%;height:100%\" width=\"640\"></iframe></div>\n",
