                "subtitle": "Український голкіпер може змінити клубну прописку.",
                "body": "<p>Андрій Лунін не отримав достатньої кількості ігрової практики в Реалі минулого сезону, а в поточне трансферне вікно приваблює інтерес з боку інших клубів.</p>\n\n<p>Як повідомляє видання Calcio Lecce, український голкіпер зацікавив новачка Серії А Лечче.</p>\n\n<p>Джерело стверджує, що крім Андрія Луніна до шорт-листа італійського клубу також входять Віто Манноне та Сімоне Скуффет.</p>\n\n<p>Минулого сезону Андрій Лунін провів за Реал лише чотири матчі у всіх турнірах, у яких він пропустив чотири м&#39;ячі.</p>\n\n<p>Нагадаємо, що раніше Лунін погодився на роль дублера Куртуа в Реалі наступного сезону.</p>\n",
