                "title": "УЕФА обсуждает грандиозную реформу Лиги чемпионов",
                "slug": "uefa-obsuzhdaet-grandioznuyu-reformu-ligi-chempionov",
                "subtitle": "В УЕФА пытаются предпринять очередную попытку модернизации главного турнира Старого Света.",
                "body": "<p>Издание Telegraph сообщает, что в ближайшее время в УЕФА обсудят реформу формата Лиги чемпионов. </p>\n<p>Разработанный вариант называют \"швейцарской системой\" и его внедрение стало возможно после разговоров о создании Европейской Суперлиги. С помощью новой реформы УЕФА надеется откинуть идею о создании нового турнира в небытие.</p>\n<p>Система разработана таким образом, что будет меньше матчей между гигантами и карликами, но больше игр топовых команд. Она предполагает, что на групповом этапе каждая команда сразится с десятью разными соперниками.</p>\n<p><span style=\"font-weight: bold;\">Будет сформирована одна группа из 36 команд.</span></p>\n<p>После 10 матчей группового этапа (с кем именно будут эти матчи определит слепой жребий) лучшие 16 команд выйдут в плей-офф. Команда, занявшая первое место в турнирной таблице, будет играть с 16-м местом, вторая — 15-м и так далее. Эта система используется в плей-офф НБА.</p>\n<p>Команды, занявшие 17-24 места, выйдут в плей-офф Лиги Европы.</p>",
