                "title": "Бенфіка з Трубіним обіграла Порту",
                "slug": "benfika-z-trubinim-obigrala-portu",
                "subtitle": "Українець провів перший сухий матч за нову команду",
                "body": "<p>У рамках сьомого туру чемпіонату Португалії Бенфіка на своєму полі приймала Порту у центральному матчі туру.</p>\n\n<p>У стартовому складі господарів вчетверте поспіль вийшов Анатолій Трубін. Український голкіпер уперше за Бенфіку провів матч без пропущених голів.</p>\n\n<p>Вирішальним став гол Анхеля Ді Марії на 68-й хвилині гри. Цей м&#39;яч став єдиним у грі.</p>\n\n<p>Зазначимо, що з 19-ї хвилини матчу Порту грав у меншості.</p>\n\n<p><strong>Бенфіка </strong>- Порту 1:0<br />\n<strong>Гол</strong>: Ді Марія, 68.</p>\n\n<p><strong>Вилучений</strong>: Кардозу, 19.</p>\n",
