                "title": "Барселона закрила трансфер Кунде за 60 млн євро",
                "slug": "barselona-zakrila-transfer-kunde-za-60-mln-yevro",
                "subtitle": "Фінансові проблеми клуба виявились такими, які можна вирішити.",
                "body": "<p>Дуже багато уваги останніми місяцями було привернуто до критичного стану фінансових справ у каталонській Барселоні, проте цьогорічна літня трансферна кампанія перекреслила всі закиди про те, що &quot;блаугранас&quot; залишили осторонь від себе статус важковаговика на ринку перемовин.</p>\n\n<p>Як стало відомо напередодні, черговим придбанням іспанського гранду став центральний захисник андалузької Севільї Жюль Кунде, за яким останніми роками полювали майже всі топ-клуби Європи.</p>\n\n<p>Барселоні вдалось домовитись про перехід 23-річного виконавця за 50 млн євро гарантованої суми відступних, до яких у майбутньому можуть додатись ще 10 млн євро у вигляді різноманітних бонусів.</p>\n\n<p>Контракт футболіста буде розрахований до 2027 року, тоді як зарплатня становитиме 8 млн євро на рік.</p>\n\n<div class=\"youtube-embed-wrapper\" style=\"height: 0px; overflow: hidden; padding-bottom: 56.25%; padding-top: 30px; position: relative; text-align: center;\"><iframe frameborder=\"0\" height=\"360\" src=\"https://www.youtube.com/embed/WCyf4AbItbQ\" style=\"position:absolute;top:0;left:0;width:100%;height:100%\" width=\"640\"></iframe></div>\n\n<p>За минулий сезон вихованець французького Бордо зіграв 44 матчі, тричі забивши та ще одного разу віддавши гольову передачу.</p>\n",
                "source": "Твітер Ніколо Скіри",
