                "title": "Венгер хотів підписати Жезуса в Арсенал ще у 2014 році",
                "slug": "venger-hotiv-pidpisati-zhezusa-v-arsenal-she-u-2014-roci",
                "subtitle": "Бразильський форвад міг опинитися в Арсеналі ще до Манчестер Сіті",
                "body": "<p>Новоспечений нападник лондонського Арсеналу Габріел Жезус, який на даний момент є одним із ключових підписань \"канонірів\" у літнє трансферне вікно, міг опинитися в клубі з Північного Лондона ще 2014 року.</p>\n\n<p>Як повідомляє <em>фанатський аккаунт afcstuff у Twitter,</em> посилаючись на бразильські ЗМІ, ще 2014 року тодішній головний тренер Арсеналу Арсен Венгер хотів підписати Жезуса.</p>\n\n<p>На той момент бразильському форварду було лише 17 років. </p>\n\n<p><img alt=\"\" src=\"/img/posts/uploads/16613764059784m76i712488.jpg\" style=\"width: 100%\" /></p>\n\n<p>У поточному сезоні АПЛ Жезус провів за Арсенал 3 матчі, забив 2 голи і віддав 3 асисти. Його трансфер із Манчестер Сіті оцінюється в 52 мільйони євро.</p>\n",
