                "title": "Реал збирається подовжити контракт з Родріго",
                "slug": "real-zbirayetsya-podovzhiti-kontrakt-z-rodrigo",
                "subtitle": "Мадридці хочуть зберегти нападника",
                "body": "<p>Реал доволі стримано поводив себе в поточне літнє трансферне вікно, проте не забуває про збереження внутрішніх ресурсів.</p>\n\n<p>Як повідомляє <em>журналіст Екрем Конур, </em>мадридський клуб працює над підписанням нового контракту з Родріго.</p>\n\n<p>Реал вже найближчим часом представить свою пропозицію агентам футболіста. Нинішній контракт чинний до літа 2025 року.</p>\n\n<p>Родріго перебрався в Реал влітку 2019 року. З того часу він провів 169 матчів, в яких відзначився 38 голами та 32 асистами.</p>\n\n<p>Нагадаємо, раніше повідомлялось, що Родріго більше не гратиме під 21-м номером. Тепер на його спині <a href=\"https://football.ua/spain/507192-vinisius-vzjav-7-jj-nomer-v-reali-rodrigo-gratime-pid-11-m.html\">красуватиметься 11-ка</a>, яку він взяв після відходу Асенсіо.</p>\n",
