                "slug": "mbappe-vidmovivsya-vid-chastini-bonusiv-u-pszh",
                "subtitle": "Клуб зумів зберегти близько 100 мільйонів євро",
                "body": "<p>Цього літа Кіліан Мбаппе відмовився від частини бонусів за контрактом із ПСЖ, повідомляє <em><a href=\"https://www.lequipe.fr/Football/Article/Entre-kylian-mbappe-et-le-psg-rendez-vous-en-2024-pour-une-eventuelle-prolongation/1417977\">L’&Eacute;quipe</a></em>.</p>\n\n<p>За інформацією джерела, Мбаппе не хотів залишати ПСЖ минулого літа, а клуб хотів зберегти гравця, але за умови, що він продовжить контракт, розрахований до літа 2024 року.</p>\n\n<p>Мбаппе відмовився від низки бонусів за нинішнім контрактом. Завдяки поступкам з боку Мбаппе, ПСЖ вдалося заощадити понад 100 мільйонів євро – суму, аналогічну до тієї, що клуб отримав би у разі продажу гравця минулого літа.</p>\n\n<p>Зазначається, що на даний момент позиція Кіліана щодо можливого продовження контракту з ПСЖ не змінилася: він хоче залишити команду влітку 2024 року як вільний агент.</p>\n\n<p>У поточному сезоні Мбаппе провів 3 матчі та забив 5 голів у французькій Лізі 1</p>\n",
