                "title": "Артем Довбик обійшов Романа Зозулю за зіграними матчам у Ла Лізі",
                "slug": "artem-dovbik-obijshov-romana-zozulyu-za-zigranimi-matcham-u-la-lizi",
                "subtitle": "Українець чудово розпочинає на узбережжі Середземного моря",
                "body": "<p>У четвер, в рамках сьомого туру іспанської Ла Ліги, Жирона завдяки голу Артема Довбика на виїзді здобула <a href=\"https://football.ua/spain/514498-viljarreal-zhirona-12-video-goliv-ta-ogljad-matchu-27092023.html\">вольову перемогу</a> на Вільярреалом (2:1).</p>\n\n<p>Для українського нападника цей матч став сьомим у Ла Лізі. За цим показником він випередив колишнього гравця севільського Бетіса Романа Зозулю. На рахунку Зозулі шість матчів без результативних дій.</p>\n\n<p>Артем Довбик за цей час у новому клубі встиг відзначитися двома голами та двома результативними передачами.</p>\n",
