                "subtitle": "Італійський фахівець хвалить \"українську\" команду",
                "body": "<p>У рамках восьмого туру іспанської <strong>Ла Ліги</strong>, <strong>Жирона Артема Довбика</strong> та <strong>Віктора Циганкова</strong> буде приймати <strong>мадридський Реал</strong>. Напередодні гри висловився головний тренер <strong>\"галактикос\" Карло Анчелотті</strong>.</p>\n\n<p><em>\"Ми маємо віддати належне тому, що відображено у таблиці. Жирона показала кращі результати у цих перших іграх, ніж інші команди. Ми маємо поважати це. Вони дуже конкурентноспроможні.</em></p>\n\n<p><em>В них є велика перевага: вони не грають у єврокубках та можуть спокійно готуватися до матчів.</em></p>\n\n<p><em>Найбільше на команди впливають міжнародні змагання збірних. Через них в нас є травми та втома.</em></p>\n\n<p><em>Минулого року сезон для нас завершився, коли ми приїхали до Жирони. То була неприємна ніч. Те, що сталося минулого сезону, не відбудеться завтра\"</em>, — наводить слова ентренадора <strong>Реалу</strong> <a href=\"https://www.espn.com/soccer/story/_/id/38519120/laliga-leaders-girona-advantage-madrid-ancelotti\">ESPN</a>.</p>\n\n<p>Матч восьмого туру <strong>Ла Ліги Жирона-Реал Мадрид</strong> відбудеться 30 вересня о 19:30.</p>\n",
